import React, { useState } from "react";
import axios from "axios";

const App = () => {
  const [dbName, setDbName] = useState("");
  const [tables, setTables] = useState([]);

  const fetchTables = async () => {
    try {
      const response = await axios.post(`http://localhost:8800/`, { dbName });
      console.log(dbName);

      console.log(response.data); // log response to console
      setTables(response.data.tables);
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div>
      <h1>Enter Database Name:</h1>
      <input
        type="text"
        value={dbName}
        onChange={(e) => setDbName(e.target.value)}
      />
      <button onClick={fetchTables}>Next</button>
      <div>
        {tables.map((table) => (
          <div key={table}>
            <p>Table Name: {table}</p>
            {/* Add your logic for editing and downloading here */}
          </div>
        ))}
      </div>
    </div>
  );
};

export default App;
